import React from "react";
import Row from "./Row";

function Table({rows, header}) {
  return (
    <table>
      <thead>
        <tr>
          <th>Name</th>
        </tr>
      </thead>
      <tbody>
        {rows.map((row) => (
          <Row key={row.id} />
        ))}
      </tbody>
    </table>
  );
}

export default Table;
